var $bm_rt;
var layers, off, prop, off;
try {
    function getValue(prop, ind, defVal, divider) {
        if (time > prop.key(ind).time) {
            return $bm_div($bm_sub(prop.value, prop.key(ind).value), divider);
        } else {
            return defVal;
        }
    }
    function getValue2(prop, ind, divider) {
        return $bm_div(prop.key(ind).value, divider);
    }
    layers = [thisComp.layer('形状图层 2')];
    off = 0;
    for (var i = 0; i < layers.length; i++) {
        prop = layers[i].effect('SM_Transform').rotation;
        off = $bm_sum(off, getValue(prop, 1, 0, layers.length));
    }
    $bm_rt = $bm_sum(value, off);
} catch (e) {
    $bm_rt = value;
}

